import React from "react";
import Settings from "../Settings/Settings";
import { Route, Routes } from "react-router-dom";
import Home from "../Home/Home";

const Main = () => {
  return (
    <>
      <Routes>
        <Route path="/settings" element={<Settings />}/>
        <Route path="/settings" element={<Home />}/>
      </Routes>
    </>
  )
}

export default Main;

